import React from "react";
import { Typography, Box, Stack, Modal, styled, Button } from "@mui/material";
import { Link } from "react-router-dom";
import { fontWeight } from "@mui/system";
import CloseIcon from '@mui/icons-material/Close';

const style = {
	position: 'absolute',
	top: '50%',
	left: '50%',
	transform: 'translate(-50%, -50%)',
	width: 500,
	bgcolor: 'background.paper',
	border: '2px solid #000',
	boxShadow: 24,
	p: 4,
};

const TokenList = ({ open, handleClose }) => {
  return (

    <Box sx={style}>
    {/* 선택한 카드의 풀 이름과 맵핑 */}
    <Typography id="modal-modal-title" variant="h6" component="h2">Token List</Typography>

    <Typography id="modal-modal-description" sx={{ mt: 2 }}>
      <Box
        component="form"
        sx={{
          '& > :not(style)': { width: 500, maxWidth: '100%' },
        }}
        noValidate
        autoComplete="off">
        {/* Deposit Input  */}
        {/* 토큰 이름, 심볼, 매핑 필요  */}
        <InputLabel component="h5">LP 토큰</InputLabel>
        <p>LPaddress: {selectPair.pair_address}</p>
        <FormControl sx={{ m: 1, width: '25ch' }} variant="outlined">
          <OutlinedInput fullWidth
            margin="dense"
            type="text"
            placeholder="예치할 토큰2 수량"
            autoFocus
            aria-label="Default"
            endAdornment={<InputAdornment position="end">{selectPair.pair_name}</InputAdornment>}
            aria-describedby="outlined-weight-helper-text"
            onChange={(e) => handleDepositInput2(e)}
          />
        </FormControl>
      </Box>
    </Typography>
    <br />
    <Stack direction="row" justifyContent="flex-end" spacing={2}>
      <Button variant="outlined" color='info' onClick={depositClose}>
        취소
      </Button>
      <Button type="submit" color='info' variant="contained" onClick={Deposit}>확인</Button>
    </Stack>

  </Box>
    // <div>

    //   Modal
    //   보유한 토큰 목록, 양
    //   토큰 추가
    //   <Box sx={{ p: 3 }}>
		// 		<Stack spacing={3} direction="column" justifyContent="center" alignItems="center">
    //       <Typography variant="h6">Token List</Typography>
    //     </Stack>
    //   </Box>
    // </div>
  );
};

export default TokenList;
